Sprzedam Mini One 1.6 benzyna 2002r

W idealnym stanie, zarówno wizualnie, jak i technicznie. W zeszłym roku poprawione zostały elementy nadwozia, na których odpryskiwał lakier – wszystko wykonane profesjonalnie, bez żadnych śladów i niedoróbek.



Specyfikacja i modyfikacje:

	•	Bardzo szybki, a przy tym oszczędny – jeździ znacznie dynamiczniej niż standardowy 1.6, a jednocześnie ma niski poziom spalania;

	•	Sportowe fotele Sparco – wygodne i stylowe;

	•	Oryginalna kierownica Sparco – wysokiej jakości, świetna w prowadzeniu;

	•	Sportowy układ 

(Cooper S)wydechowy – piękny dźwięk i lepsza dynamika;

	•	Cała elektryka w pełni sprawna – wszystko działa bez zarzutu;

	•	System audio z subwooferem – doskonała jakość dźwięku;

	•	Oryginalny przebieg – 144 000 km;

	•	Niedawno wymienione wszystkie oleje i filtry – gotowy do jazdy, bez dodatkowych kosztów.



Dodatkowo:

	•	Komplet opon letnich na oryginalnych felgach Mini Cooper S



Nie sprzedawalibyśmy go, ale czas na coś nowszego. Nowy właściciel będzie bardzo zadowolony – samochód jest w pełni sprawny i gotowy do jazdy, a prowadzenie go to czysta przyjemność!
